  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Minnesota
  Valley National Wildlife Refuge outlines Refuge accomplishments during the 1999
  fiscal year. The report begins with an introduction to the Refuge. Information about
  monitoring and studies- including surveys and censuses and studies and investigations-
  is provided next. Habitat restoration and management projects are also covered;
  activities include wetland restoration, upland restoration, water level management,
  moist soil management, farming, timber management, prescribed burning, and vegetation
  control. Fish and wildlife management are discussed next with emphasis on bird banding,
  disease monitoring, reintroductions, nest structures, and animal control. Coordination
  activities, such as interagency coordination, tribal coordination, and private land
  activities, are outlined. The resource protection section provides an update on
  law enforcement, wildfire preparedness, permits, contaminant investigation, water
  rights, and land acquisition support. Information about public education and recreation
  is given including visitor services and outreach. Finally, comprehensive management
  planning and general administration are discussed in the Refuge planning and administration
  section.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
